import React from "react";
import { Avatar, Card } from "antd";
const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">
          짹쨱
          <br />
        </div>,
        <div key="followings">
          팔로잉
          <br />
        </div>,
        <div key="followings">
          팔로워
          <br />
        </div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>yh</Avatar>} title="dnwk" />
    </Card>
  );
};

export default UserProfile;
